import React from 'react'
import { Link } from 'react-router-dom'
import profilesdata from './profilesdata'

function Profiles() {

    const allProfiles = profilesdata.map(profile => {
        return(
            <div>
                <h2>{profile.name} - {profile.price}</h2>
            </div>
        )
    })

  return (
    <div>
      <h1>Profiles</h1>
    </div>
  )
}

export default Profiles
